import React from 'react';
import { FaPhp, FaLaravel, FaHtml5, FaCss3Alt, FaNodeJs, FaPython, FaAngular, FaReact, FaVuejs, FaGit } from "react-icons/fa";
import { DiMongodb, DiJavascript1 } from "react-icons/di";



const UsedTech = () => {
  return (
    <div className="tech mt-5">
      <div className="container">
        <div className="row justify-content-center">
          <div className="text-center mt-5">
            <h2>Technologies We Use</h2>
            <p>Our technology stack is tested and safe,
              corresponding with the latest trends in web development.</p>
          </div>
        </div>
        <div className="items mt-5 d-flex flex-wrap justify-content-around">
          {items.map((item, idx) => {
            return (
              <div className="item my-5 mx-3 p-4">
                <span>{item.icon}</span>
                <h6>{item.title}</h6>
              </div>
            )
          })}
        </div>
      </div>
    </div>
  );
};

export default UsedTech;

const items = [
  {icon: <FaVuejs style={{width:"5rem", height:"5rem", color:"#32a2b8"}} /> },
  {icon: <FaReact style={{width:"5rem", height:"5rem", color:"#32a2b8"}}/>},
  {icon: <FaAngular style={{width:"5rem", height:"5rem", color:"#32a2b8"}}/>},
  {icon: <FaCss3Alt style={{width:"5rem", height:"5rem", color:"#32a2b8"}}/>},
  {icon: <FaHtml5 style={{width:"5rem", height:"5rem", color:"#32a2b8"}}/>},
  {icon: <FaGit style={{width:"5rem", height:"5rem", color:"#32a2b8"}}/>},
  {icon: <FaLaravel style={{width:"5rem", height:"5rem", color:"#32a2b8"}}/>},
  {icon: <FaNodeJs style={{width:"5rem", height:"5rem", color:"#32a2b8"}}/>},
  {icon: <FaPhp style={{width:"5rem", height:"5rem", color:"#32a2b8"}}/>},
  {icon: <FaPython style={{width:"5rem", height:"5rem", color:"#32a2b8"}}/>},
  {icon: <DiJavascript1 style={{width:"5rem", height:"5rem", color:"#32a2b8"}}/>},
  {icon: <DiMongodb style={{width:"5rem", height:"5rem", color:"#32a2b8"}}/>}
]
